                  "description": "Comma-delimited list of additional calculated metric metadata fields\nto include on response.",
                  "required": false,
                  "style": "form",
                  "explode": false,
                  "schema": {
                     "type": "array",
                     "items": {
                        "type": "string",
                        "enum": [
                           "reportSuiteName",
                           "ownerFullName",
                           "modified",
                           "tags",
                           "definition",
                           "compatibility"
                        ]
                     },
                     "enum": [
                        "reportSuiteName",
                        "ownerFullName",
                        "modified",
                        "tags",
                        "definition",
                        "compatibility"
                     ]
                  }
               }
            ],
            "responses": {
               "200": {
                  "description": "successful operation",
                  "content": {
                     "application/json": {
                        "schema": {
                           "$ref": "#/components/schemas/AnalyticsCalculatedMetric"
                        }
                     }
                  }
               },
               "403": {
                  "description": "Requesting non-shared calculated metrics for other users is\nrestricted to admin users",
                  "content": {
                     "application/json": {
                        "schema": {
